  true,\n\t\"url\": null,\n\t\"notes\": \"The USPTO Trademark Daily Application Image
  24 Hour Box (2009 - Present) consists of two datasets:rn(A)  24 Hour Box file, hryymmdd.ziprn(B)
  \ 24 Hour Box Supplemental file, hrsyymmdda.zip, with optional files, hrsyymmddb.zip,
  hrsyymmddc.zip, etc.rnrn(A)  The 24 Hour Box zipfile contains images of daily Trademark
  applications in either JPG format (black and white, grayscale, or color) or TIFF
  format (black and white) processed through the Trademark Image Capture and Retrieval
  System (TICRS) and viewable using any standard image viewer for Calendar Year 2009
  (January through December). JPG images are accompanied by an XML file that contains
  text information about the application. TIFF images contain the application number
  embedded in the image (stamped prior to scan).rnrnOn November 2, 2003, the USPTO
  began accepting electronic submissions of Trademark applications from the International
  Bureau (IB) and continued to accept electronic submissions of Trademark applications
  from the Trademark Electronic Application System (TEAS), as well as paper submissions.rnrnBeginning
  November 2, 2003, the Daily Trademark Application Image 24 Hour Box contains:rnrn1.
  \ Cropped image file(s) in JPG format (black and white, grayscale, or color) for
  electronic applications filed through TEAS (78 Series Code and 77 Series Code) or
  the IB (79 Series Code). The cropped image file(s) in JPG format will be accompanied
  by an XML file that contains text information about the application.rnrn2. a.  Full-page
  drawing image(s) in TIFF format (black and white) for black and white paper submissions
  of Trademark applications (76 Series Code, or any amended black and white submissions).rnrn2.
  b.  Full-page drawing image(s) in JPG format (color) for color paper submissions
  of Trademark applications (also 76 Series Code, or any amended color paper submissions).rnrn(B)
  \ The 24 Hour Box Supplemental zipfile(s) contain Trademark cropped TIFF (black
  and white) or cropped JPG (color) image files from paper submissions of Trademark
  applications. These cropped images are available one day after they appear as full-page
  drawing images in the 24 Hour Box zipfiles (See 2. a. and 2. b. above).rnrnAvailable
  daily (Monday-Friday) (excludes U.S. Federal holidays) for no charge. Average daily
  filesizes are 200 MB (compressed) for the 24 Hour Box zipfile and 14 MB (compressed)
  for the 24 Hour Box Supplemental zipfile(s) http://trademarks.reedtech.com/tmappi.php\",\n\t\"license_title\":
